import Header from "../components/Header"
import Footer from"../components/Footer";
import City from "./City";
function Home(){ 
    return(
    <div class ="container-fuid" className="App">
        <div class="row">
            <Header />
        </div>
        <div class="row justify-content-around mt-4">
        <City/>
        </div>
        <div class="row ">
            <Footer/>
        </div>
        
    </div>
    );
}

export default Home
